import React, { Component } from 'react';
import InputClient from '../components/Devis/inputClient.js';
import InputAdress from '../components/Devis/inputAdress.js';


export default class Devis extends Component {


    componentDidMount() {

    }

    render() {

        return (
            <div className="container">
                <div className='row' style={{ marginTop: '2%' }}>
                    <div className="col-3"><InputClient /></div>
                    <div className="col-3"><InputAdress /></div>
                    <div className="col-3 ">
                    <div class="input-group mb-3">
                        <div class="input-group-prepend">
                            <label class="input-group-text" for="inputGroupSelect01">Options</label>
                        </div>
                        <div className="AutocompleteText">
                        <select class="custom-select" id="inputGroupSelect01">
                            <option selected>Choose...</option>
                            <option value="1">One</option>
                            <option value="2">Two</option>
                            <option value="3">Three</option>
                        </select>
                        </div>
                    </div>
                    <div className="col-3 AutocompleteText"><input className="form-control" type="text" placeholder="Date du devis" /></div>
                    </div>
                </div>
            </div>
        )
    }
}
